import React from "react";
import MainLayout from "./components/layout/MainLayout";
import Login from "./components/login/Login"
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
          <Routes>
              <Route path="/login" element={<Login />} />
 
              <Route path='/' exact>
                  <MainLayout />
              </Route>
          </Routes>
    </BrowserRouter>
  );
}

export default App;
